// Solution 2:
const moveElementToEnd = (array, toMove) => {
    let i = 0;
    let j = array.length - 1;

    while (i <= j) {
        if (array[j] === toMove) {
            j--;
        } else if (array[i]!== toMove) {
            i++;
        } else {
            const temp = array[i];
            array[i] = array[j];
            array[j] = temp;
            i++;
            j--;
        }
    }

    return array;
};

